import React from 'react';

function Header() {
  return (
    <div>
      <h1>Header</h1>
      <ul>
        <li>Name</li>
        <li>About Me</li>
        <li>Portfolio</li>
        <li>Contact</li>
        <li>Resume</li>
      </ul>
    </div>
  );
}

export default Header;
